import React, { Component } from 'react';
import './App.css';
import Home from './pages/Home';
import {
    BrowserRouter as Router,
    Switch,
    Route,
  } from "react-router-dom";

class App extends React.Component {
render(){
    return(
            <Router>
                    <Switch>
                        <Route exact path='/' component={Home}/>
                    </Switch>
            </Router>
    );
    }
}

export default App;
